const canvas = document.getElementById('canvas1');
const ctx = canvas.getContext('2d');

canvas.width = 700;
canvas.height = 700;
function start(){
    
    image1.src =      
        //#region 
        'data:image/png;base64,';
        //#endregion


    ctx.drawImage(image1,0,0, canvas.width, canvas.height);

    const pixels = ctx.getImageData(0,0, canvas.width, canvas.height);
    const mappedImage = [];
    for (let y = 0; y < canvas.height; y++){
        let row = [];
        for (let x = 0; x < canvas.width; x++){
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
            const brightness = calcBrightness(red, green, blue);
            const cell = [
                cellBrightness = brightness, 
            ];
            row.push(cell);
        }
        mappedImage.push(row);
    }
    function calcBrightness(red,green,blue){
        return Math.sqrt(
            (red * red) * .299 +
            (green * green) * .587 + 
            (blue * blue) * .114
        )/100;
    }

    

    ctx.globalAlpha = 1;
    ctx.fillStyle = 'rgb(0,0,0)';
    ctx.fillRect(0,0,canvas.width,canvas.height);
    return mappedImage
}
const finMappedImage = start();

const numOfParticles = 5000;



class Particle {
    constructor(){
        this.dead = 0;
        this.x = Math.random() * canvas.width;
        this.y = 0;
        this.speed = 0;
        this.velocity = Math.random() * 1.0;
        this.size = Math.random() * 4.5 + 1;
        this.position1 = Math.floor(this.y);
        this.position2 = Math.floor(this.x);
    }
    update(){
        if (this.dead != 1){
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = finMappedImage[this.position1][this.position2][0];
            let movement = (2.6 - this.speed) + this.velocity;

            this.y += movement;
            if(this.y >= canvas.height){
                this.del();
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
        }
    }
    draw(){
        if (this.dead != 1){
            ctx.beginPath();
            var r = () => (Math.random() * 205 + 50);
            var color = `rgb(${r()}, ${r()}, ${r()})`;
            ctx.fillStyle = color;
            ctx.fillRect(this.x, this.y, this.size, this.size);
            ctx.fill();
        }
    }
    del(){
        this.speed = 0;
        this.velocity = 0;
        this.size = 0;
        this.dead = 1;
    }
}
let particlesArray = [];
function init(){
    
    for (let i = 0; i < particlesArray.length; i++){
        if (particlesArray[i] != null){
            particlesArray[i].del();
            particlesArray.pop();
            
        }
    }
    for (let i = 0; i < numOfParticles; i++){
        
        particlesArray.push(new Particle);
    }
}

function animate(){
    
    requestAnimationFrame(animate);
    for (let i = 0; i < particlesArray.length; i++){
        if (particlesArray[i] != null){
            if (particlesArray[i].size > 0) {
                particlesArray[i].update();
                particlesArray[i].draw();
            }else{ particlesArray[i] = null;}
        }
    }
    ctx.globalAlpha = 0.05;
    ctx.fillStyle = 'rgb(0,0,0)';
    ctx.fillRect(0,0,canvas.width,canvas.height);
    
    
    
}


document.addEventListener('click', function(){
    
    count++;
    if (count > 3){
        location.reload();
    }
    init();
    animate();
})


